import React from "react";
import './phones.css'

const Mobiles = ({ mobiles }) =>{
    return (
        <div>
          <h1>List of available mobile</h1>
          {mobiles.map((mobile) => (
            <div class="mobile">
                <h2>name:{mobile.name}</h2>
                <h2>price:{mobile.price}</h2>
            </div>
          ))}
        </div>
    )
}

export default Mobiles;
